    [],nt"num_tags": 32,nt"name": "blackwater-national-wildlife-complex-blackwater-national-wildlife-refuge-susquehanna-natio",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Blackwater
    National Wildlife Refuge outlines Refuge accomplishments during the 1995 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, manpower programs, volunteer programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, croplands, fire management, and pest control. The wildlife section of the
    report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    animal control, marking and banding, and disease control. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, wildlife observation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, communication systems,
    computer systems, and energy conservation. Cooperative programs and items of interest
    are provided at the end. Refuge brochures and field guides are included.",nt"owner_org":
